
/*
阅读sign
中国联通---搜索 阅读专区 --- 看2分钟以上小说
阅读抓包地址 https://10010.woread.com.cn/ng_woread_service/rest/history/addReadTime
过滤addReadTime找比较方便
需要找请求体里面的sign值

龟兔赛跑sign
中国联通---搜索 阅读专区 --- 顶部轮播的活动最后一个
唤醒抓包地址 https://10010.woread.com.cn/ng_woread_service/rest/rabbitActivity/wakeRabbit
先让乌龟跑后才有唤醒(0点刷新),一天只有一次
抓包请求体里面的sign值,理论可以通用龟兔里面

如没唤醒抓包以下链请求体里面的sign值代替先
龟兔抓包地址 https://10010.woread.com.cn/ng_woread_service/rest/rabbitActivity/queryActivityData

抽奖变量
在阅读sign或者乌龟sign的连接 里面的请求头找 或者https://10010.woread.com.cn的链接找
在请求头上cookie上的 uszeraccount=后面的值或者phoneNumber4net=后面的值


变量名:soy_ltgtsp_data
变量值:抽奖变量&阅读sign&龟兔赛跑sign

定时自己算,跑一次是2分钟阅读,2分钟内只能跑一次,频繁跑阅读会提示获取密钥失败
0/2 9-23 * * *
*/


